    false,nt"url": null,nt"notes": "This handbook provides a strategy for anyone
    who must identify priorities (refuge resources of concern) that will guide future
    refuge wildlife and habitat management. It summarizes existing guidance and provides
    a process that will give you information and products needed to write a Comprehensive
    Conservation Plan or a Habitat Management Plan as well as products critical to both
    short- and long-term management decisions on your refuge. The following pages guide
    users through Eight Steps to determine a refugeu2019s resources of concern and management
    priorities. In addition, Work Product sections associated with each step define
    actual products that you can develop by applying the process. These work products
    are designed to contribute to critical stages of Comprehensive Conservation Plan
    and Habitat Management Plan development. The products build upon one another, and,
    in many cases, will become part of the final Comprehensive Conservation Plan or
    step-down plan(s).",nt"license_title": "License Not Specified",nt"extras":
